import React from 'react'


const LoginPage = () => {

  return (
    <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor:'#181f38', width: '100%', height: '100vh'}}>
      <div style={{border: '2px solid', width: '600px', height: '400px', borderRadius:'20px',backgroundColor: '#25283c'}}>
        <div style={{display: 'flex', flexDirection: 'column',alignItems:'flex-start', margin:'30px'}}>
          <h1 style={{color:'#7b49b5'}}>Signup</h1>
          <label style={{color:'#7b49b5',marginBottom:'10px'}}>Username:</label>
          <input type='text' placeholder='Username' aria-label='Username' style={{
            width: '-webkit-fill-available',
            height: '35px',
            borderRadius: '10px',
            backgroundColor: '#3b3f51'
          }}/>
        </div>

      </div>

    </div>
  )
}

export default LoginPage
